// src/sections/Contact/Contact.jsx
import React from "react";
import styles from "./Contact.module.css";
import { 
  FaFacebookF, FaInstagram, FaLinkedinIn, FaGithub, FaTwitter,
  FaMapMarkerAlt, FaPhoneAlt, FaEnvelope
} from "react-icons/fa";
import FadeIn from "../../components/FadeIn";

const Contact = () => {
  return (
    <section id="contact" className={styles.contact}>
      <div className={styles.wrapper}>
        <FadeIn>
          <div className={styles.card}>
            <div className={styles.left}>
              <h2>Keep In Touch With Us</h2>
              <p>Weâ€™d love to hear from you. Reach out via any method below.</p>
              <div className={styles.info}>
                <p><FaMapMarkerAlt className={styles.icon} /> Startups Valley TBI, Amal Jyothi College of Engineering, Koovappally, Kerala 686518</p>
                <p><FaPhoneAlt className={styles.icon} /> +91 9988776655</p>
                <p><FaEnvelope className={styles.icon} /> support@netscorp.in</p>
              </div>
              <div className={styles.socials}>
                <a href="https://facebook.com"><FaFacebookF /></a>
                <a href="https://instagram.com"><FaInstagram /></a>
                <a href="https://linkedin.com"><FaLinkedinIn /></a>
                <a href="https://github.com"><FaGithub /></a>
                <a href="https://twitter.com"><FaTwitter /></a>
              </div>
            </div>
            <div className={styles.right}>
              <iframe
                title="Google Map"
                src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d13156.900271933364!2d76.81802239999999!3d9.528361799999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e1!3m2!1sen!2sin!4v1747849589035!5m2!1sen!2sin"
                width="100%"
                height="100%"
                allowFullScreen=""
                loading="lazy"
                referrerPolicy="no-referrer-when-downgrade"
                className={styles.map}
              />
            </div>
          </div>
        </FadeIn>
      </div>
    </section>
  );
};

export default Contact;
